        0: "Die gesamten 10 Fingerbreiten dieses Steines sind ein Diamant feinster Qualit\xE4t, ohne nur einen Hauch von Verunreinigung. Klar-weiss, schillernd, fast vollst\xE4ndig transparent - mit Ausnahme der innersten Mitte. Eingeschlossen dort befindet sich ein geschliffener Saphir, gelblichen Hauches, ein Stern im Sternschliff, hunderte von Faetten. Die unumschreibliche Perfektion des Steines wirkt in ihrer G\xE4nze nat\xFCrlich und klar; doch wie dies unter dem enormen Druck des Paneteninneren entstand, ohne dass der Saphir zerbrach, ist ein R\xE4tsel. Selbst der kleingeistigste aller Kleingeister erkennt, dass der besitz dieses Steines eben dieses die gesamten Silbermarken, den Grat der Welt, und alles, was darauf-darin sein mag, erkaufen und regieren k\xF6nnte, mit geschickten Worten... Der Preis ist sicherlich und im wahrsten Sinne des Wortes, unermesslich."
